import React from 'react';

const ReturnPolicy = () => {
  return <div className='putMargin'>
      <h1><u>RETURNS</u></h1>
    Items shipped from Quilling Art.com can be returned within 30 days of receipt of shipment in most cases. Some products have different policies or requirements associated with them.
    {""}
    <h1><u>RETURN INSTRUCTIONS</u></h1>
    All returns must include a tracking number (USPS, UPS, FedEx). Please provide us with the tracking number for your return (support@QuillingArt.com). Failure to do so may delay the processing of your return/credit.{""}
    <h1><u>EXCHANGES</u></h1> 
    At this time, we do not accept exchanges. {""}
    <h1><u>RETURN ADDRESS</u></h1>
    <address>
     Quilling Art| Returns<br/>
      5900 W Golden AVE <br/>
      Kirkland, WA 98804 <br/>
      </address>
  </div>;
};

export default ReturnPolicy;
